import React from 'react';
import Contact from './Contact';

class Contacts extends React.Component {
    render() {
        return(
            <React.Fragment>
                <Contact name='LinkedIn'/>
                <Contact name='Github'/>
                <Contact name='Email'/>
            </React.Fragment>
        )
    }
}

export default Contacts;
